"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     0.125 mg (100): $177.00",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F6038655\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Duboisine (FR);",
"     </li>",
"     <li>",
"      Egacene (NL);",
"     </li>",
"     <li>",
"      Egazil Duretter (DK, FI, NO, SE);",
"     </li>",
"     <li>",
"      Eyosin (PH);",
"     </li>",
"     <li>",
"      Levsin SL (HK);",
"     </li>",
"     <li>",
"      Neo-Allospasmin (BG);",
"     </li>",
"     <li>",
"      Nuspas (TW)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F181178\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Blocks the action of acetylcholine at parasympathetic sites in smooth muscle, secretory glands, and the CNS; increases cardiac output, dries secretions, antagonizes histamine and serotonin",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F181194\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: 2-3 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: 4-6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Well absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Crosses placenta; small amounts enter breast milk",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 50%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 3-5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine",
"    </p>",
"   </div>",
"  </div>",
