" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pathology of granuloma annulare - palisading granuloma (H&amp;E 40x)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Scanning view showing a broad area necrobiosis. This area is surrounded by a peripheral rim of histiocytes and lymphocytes and a few multinucleated giant cells. The adjacent areas of dermis show normal collagen bundles and fibroblast nuclei (H&amp;E 40x).",
"    <div class=\"footnotes\">",
"    </div>",
