" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Patency rate with streptokinase, but not with tPA, is related to earlier treatment",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 358px; height: 315px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The rate of a patent artery, defined as TIMI flow grade 3, with streptokinase (SK) therapy is greater when the drug is administered within three hours, compared to longer than three hours, after symptom onset (p = 0.001). The frequency of TIMI grade 3 flow after tissue-type plasminogen activator (tPA) does not display this time dependence.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Steg PG, LaPerche T, Golmard J-L, et al, for the PERM Study Group. J Am Coll Cardiol 1998; 31:776.",
"    </div>",
